// First, install the required dependencies:
// npm install react-router-dom @mysten/sui.js @tanstack/react-query @mui/material @emotion/react @emotion/styled
// Note: @mysten/dapp-kit is recommended for better integration, but we'll use @mysten/sui.js with wallet-kit for balance and data fetching.
// If you switch to dApp Kit later, it provides useSuiClientQuery for easier queries.

import React, { useEffect, useState } from "react";
import {
  WalletKitProvider,
  ConnectButton,
  useWalletKit,
} from "@mysten/wallet-kit";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
  useNavigate,
  useLocation,
} from "react-router-dom";
import { getFullnodeUrl, SuiClient } from "@mysten/sui.js/client";
import { getTransactionDigests } from "@mysten/sui.js/rpc-client";
import {
  Tabs,
  Tab,
  Box,
  AppBar,
  Toolbar,
  Typography,
  Container,
} from "@mui/material";
import {
  QueryClient,
  QueryClientProvider,
  useQuery,
} from "@tanstack/react-query";

// Initialize SuiClient for devnet (change to testnet/mainnet as needed)
const client = new SuiClient({
  url: getFullnodeUrl("devnet"),
});

// QueryClient for data fetching
const queryClient = new QueryClient();

// Protected Route Component - Redirects to dashboard if connected, else shows connect page
function ProtectedRoute({ children }) {
  const { currentWallet } = useWalletKit();
  const navigate = useNavigate();

  useEffect(() => {
    if (!currentWallet) {
      navigate("/");
    }
  }, [currentWallet, navigate]);

  return currentWallet ? children : <Navigate to="/" />;
}

// Home Page - Connection Page
function HomePage() {
  const { currentWallet } = useWalletKit();
  const navigate = useNavigate();

  useEffect(() => {
    if (currentWallet) {
      navigate("/dashboard");
    }
  }, [currentWallet, navigate]);

  return (
    <div style={{ padding: "20px", textAlign: "center" }}>
      <h1>Exemplu Sui + Slush Wallet</h1>
      <ConnectButton />
    </div>
  );
}

// Tab Panel Component
function TabPanel({ children, value, index, ...other }) {
  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`tabpanel-${index}`}
      aria-labelledby={`tab-${index}`}
      {...other}
    >
      {value === index && <Box sx={{ p: 3 }}>{children}</Box>}
    </div>
  );
}

// Account Component
function Account() {
  const { currentWallet } = useWalletKit();

  return (
    <div>
      <h2>Contul Meu</h2>
      <p>
        <strong>Adresă:</strong> {currentWallet?.address}
      </p>
      {/* Add more account details here */}
    </div>
  );
}

// Transactions Component
function Transactions() {
  const { currentWallet } = useWalletKit();

  const {
    data: transactions,
    isLoading,
    error,
  } = useQuery({
    queryKey: ["transactions", currentWallet?.address],
    queryFn: async () => {
      if (!currentWallet?.address) return [];
      const digests = await getTransactionDigests(client, {
        filter: { FromAddress: currentWallet.address },
        order: "descending",
        limit: 10,
      });
      // Fetch full transaction details if needed
      return digests.map((digest) => ({ digest })); // Simplified
    },
    enabled: !!currentWallet?.address,
  });

  if (isLoading) return <div>Încărcare tranzacții...</div>;
  if (error) return <div>Eroare: {error.message}</div>;

  return (
    <div>
      <h2>Tranzacții</h2>
      <ul>
        {transactions?.map((tx, index) => (
          <li key={index}>{tx.digest}</li>
        ))}
      </ul>
    </div>
  );
}

// Uploads Component (Placeholder - for file uploads, e.g., to IPFS for NFTs)
function Uploads() {
  // Implement file upload logic here, e.g., to IPFS
  return (
    <div>
      <h2>Uploaduri</h2>
      <p>Aici poți încărca fișiere (ex: pentru NFT-uri).</p>
      {/* Add upload form */}
    </div>
  );
}

// Balance Component
function Balance() {
  const { currentWallet } = useWalletKit();

  const {
    data: balance,
    isLoading,
    error,
  } = useQuery({
    queryKey: ["balance", currentWallet?.address],
    queryFn: async () => {
      if (!currentWallet?.address) return 0;
      const bal = await client.getBalance({
        owner: currentWallet.address,
      });
      return parseInt(bal.totalBalance, 10) / 10 ** 9; // Convert to SUI (9 decimals)
    },
    enabled: !!currentWallet?.address,
  });

  if (isLoading) return <div>Încărcare sold...</div>;
  if (error) return <div>Eroare: {error.message}</div>;

  return (
    <div>
      <h2>Sold Curent</h2>
      <p>{balance} SUI</p>
    </div>
  );
}

// NFTs Component
function NFTs() {
  const { currentWallet } = useWalletKit();

  const {
    data: nfts,
    isLoading,
    error,
  } = useQuery({
    queryKey: ["nfts", currentWallet?.address],
    queryFn: async () => {
      if (!currentWallet?.address) return [];
      const objects = await client.getOwnedObjects({
        owner: currentWallet.address,
        options: {
          showType: true,
          showDisplay: true,
          showContent: true,
        },
      });
      // Filter for NFTs (e.g., types containing 'nft' or specific types)
      return objects.data.filter(
        (obj) =>
          obj.data?.type?.includes("nft") || obj.data?.display?.type === "nft"
      );
    },
    enabled: !!currentWallet?.address,
  });

  if (isLoading) return <div>Încărcare NFT-uri...</div>;
  if (error) return <div>Eroare: {error.message}</div>;

  return (
    <div>
      <h2>NFT-uri</h2>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fill, minmax(200px, 1fr))",
          gap: "20px",
        }}
      >
        {nfts?.map((nft) => (
          <div
            key={nft.data?.objectId}
            style={{ border: "1px solid #ccc", padding: "10px" }}
          >
            <img
              src={
                nft.data?.content?.fields?.image || nft.data?.display?.image_url
              }
              alt="NFT"
              style={{ width: "100%", height: "150px", objectFit: "cover" }}
            />
            <p>
              <strong>{nft.data?.display?.name}</strong>
            </p>
            <p>{nft.data?.display?.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

// Dashboard Component with Tab Bar
function Dashboard() {
  const [value, setValue] = useState(0);
  const location = useLocation();

  // Sync tab with URL path
  useEffect(() => {
    const pathToTab = {
      "/dashboard/account": 0,
      "/dashboard/transactions": 1,
      "/dashboard/uploads": 2,
      "/dashboard/balance": 3,
      "/dashboard/nfts": 4,
    };
    const currentTab = Object.keys(pathToTab).find((path) =>
      location.pathname.startsWith(path)
    );
    if (currentTab) {
      setValue(pathToTab[currentTab]);
    }
  }, [location.pathname]);

  const handleTabChange = (event, newValue) => {
    const paths = [
      "/dashboard/account",
      "/dashboard/transactions",
      "/dashboard/uploads",
      "/dashboard/balance",
      "/dashboard/nfts",
    ];
    // Use navigate to change route
    window.location.href = paths[newValue]; // Simple redirect; use useNavigate for SPA navigation
  };

  return (
    <Box sx={{ width: "100%" }}>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Dashboard
          </Typography>
        </Toolbar>
      </AppBar>
      <Box sx={{ borderBottom: 1, borderColor: "divider" }}>
        <Tabs
          value={value}
          onChange={handleTabChange}
          aria-label="dashboard tabs"
        >
          <Tab label="Contul Meu" />
          <Tab label="Tranzacții" />
          <Tab label="Uploaduri" />
          <Tab label="Sold Curent" />
          <Tab label="NFT" />
        </Tabs>
      </Box>
      <TabPanel value={value} index={0}>
        <Account />
      </TabPanel>
      <TabPanel value={value} index={1}>
        <Transactions />
      </TabPanel>
      <TabPanel value={value} index={2}>
        <Uploads />
      </TabPanel>
      <TabPanel value={value} index={3}>
        <Balance />
      </TabPanel>
      <TabPanel value={value} index={4}>
        <NFTs />
      </TabPanel>
    </Box>
  );
}

// Main App with Routing
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route
          path="/dashboard/*"
          element={
            <ProtectedRoute>
              <Container maxWidth="md">
                <Dashboard />
              </Container>
            </ProtectedRoute>
          }
        >
          <Route path="account" element={<Account />} />
          <Route path="transactions" element={<Transactions />} />
          <Route path="uploads" element={<Uploads />} />
          <Route path="balance" element={<Balance />} />
          <Route path="nfts" element={<NFTs />} />
          <Route index element={<Navigate to="account" />} />
        </Route>
      </Routes>
    </Router>
  );
}

// Root with Providers
export default function Root() {
  return (
    <QueryClientProvider client={queryClient}>
      <WalletKitProvider autoConnect={true} chains={["sui:devnet"]}>
        <App />
      </WalletKitProvider>
    </QueryClientProvider>
  );
}
